import { Fragment } from 'react';
import './App.css';

function App() {

  function ImageCar({source,description}) {

    return(
      <img src={source} alt={description}></img>
    )
  }

  function Title ({text}) {
    return (
      <h1>{text}</h1>
    )
  }

  function Description ({text}) {
    return (
      <p>{text}</p>
    )
  }

  return (
    <div>
      <Image src="https://www.codingexercises.com/img/2022-01-25/001-bmw-blue.jpg" alt="BMW"></Image>
      <Title text="My BMW"></Title>
    </div>
  )

}

export default App;
